import React, { Fragment } from 'react'

import { makeStyles } from '@material-ui/core/styles';
import { Paper } from '@material-ui/core';

const useStyles = makeStyles(theme ({
    paper: {
        height: 450,
        width: '100%',
    },
}))

function Body() {

    const classes = useStyles();

    return (
        <Fragment>
            <Paper className={classes.paper}>

            </Paper>
        </Fragment>
    );
}

export default Body;
